import React, { useState } from 'react';
import { Link } from 'react-router-dom';

interface Course {
  id: number;
  title: string;
  instructor: string;
  rating: number;
  students: number;
  price: number;
  category: string;
  image: string;
}

const Courses: React.FC = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const [selectedCategory, setSelectedCategory] = useState('all');

  // Mock data - replace with actual data from your backend
  const courses: Course[] = [
    {
      id: 1,
      title: 'Blockchain Development Fundamentals',
      instructor: 'John Doe',
      rating: 4.5,
      students: 1234,
      price: 99.99,
      category: 'Development',
      image: '/images/course1.jpg'
    },
    {
      id: 2,
      title: 'Smart Contract Development',
      instructor: 'Jane Smith',
      rating: 4.8,
      students: 856,
      price: 149.99,
      category: 'Development',
      image: '/images/course2.jpg'
    },
    {
      id: 3,
      title: 'Blockchain Business Applications',
      instructor: 'Mike Johnson',
      rating: 4.3,
      students: 567,
      price: 79.99,
      category: 'Business',
      image: '/images/course3.jpg'
    },
  ];

  const categories = ['all', 'Development', 'Business', 'Finance', 'Design'];

  const filteredCourses = courses.filter(course => {
    const matchesSearch = course.title.toLowerCase().includes(searchTerm.toLowerCase()) ||
                         course.instructor.toLowerCase().includes(searchTerm.toLowerCase());
    const matchesCategory = selectedCategory === 'all' || course.category === selectedCategory;
    return matchesSearch && matchesCategory;
  });

  return (
    <div className="section">
      <div className="container">
        <h1 className="section-title">Explore Courses</h1>

        {/* Search and Filter */}
        <div style={{ marginBottom: '2rem' }}>
          <div style={{ display: 'flex', gap: '1rem', marginBottom: '1rem' }}>
            <input
              type="text"
              placeholder="Search courses..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              className="form-input"
              style={{ flex: 1 }}
            />
            <select
              value={selectedCategory}
              onChange={(e) => setSelectedCategory(e.target.value)}
              className="form-input"
              style={{ width: '200px' }}
            >
              {categories.map(category => (
                <option key={category} value={category}>
                  {category.charAt(0).toUpperCase() + category.slice(1)}
                </option>
              ))}
            </select>
          </div>
        </div>

        {/* Course Grid */}
        <div className="grid grid-3">
          {filteredCourses.map(course => (
            <div key={course.id} className="card">
              <div style={{ height: '200px', backgroundColor: '#eee' }}></div>
              <div style={{ padding: '1.5rem' }}>
                <h3>{course.title}</h3>
                <p style={{ color: '#666', marginTop: '0.5rem' }}>{course.instructor}</p>
                <div style={{ display: 'flex', alignItems: 'center', gap: '0.5rem', marginTop: '0.5rem' }}>
                  <span style={{ color: '#f7c32e' }}>★</span>
                  <span>{course.rating}</span>
                  <span style={{ color: '#666' }}>({course.students} students)</span>
                </div>
                <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginTop: '1rem' }}>
                  <span style={{ fontWeight: 'bold', fontSize: '1.2rem' }}>${course.price}</span>
                  <Link to={`/courses/${course.id}`} className="btn btn-primary">
                    Learn More
                  </Link>
                </div>
              </div>
            </div>
          ))}
        </div>

        {/* No Results */}
        {filteredCourses.length === 0 && (
          <div style={{ textAlign: 'center', padding: '3rem' }}>
            <h3>No courses found</h3>
            <p style={{ color: '#666' }}>Try adjusting your search or filter criteria</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default Courses;
